import React from "react";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";

const HomePage = () => {
  const handleDragStart = (e) => e.preventDefault();

  const responsive = {
    0: { items: 1 },
    568: { items: 2 },
    1024: { items: 3 },
  };

  const items = [
    <img
      src="/Big%20Daddy.jpg"
      alt="Big Daddy"
      onDragStart={handleDragStart}
      className="image-carousel"
    />,
    <img
      src="/Big%20Sister.jpg"
      alt="Big Sister"
      onDragStart={handleDragStart}
      className="image-carousel"
    />,
    <img
      src="/Columbia.jpg"
      alt="Columbia"
      onDragStart={handleDragStart}
      className="image-carousel"
    />,
  ];

  return (
    <React.Fragment>
      <div>
        <AliceCarousel
          mouseTracking
          autoHeight
          autoWidth
          items={items}
          responsive={responsive}
        />
      </div>

      <style jsx>{`
        div {
          border: 1px solid red;
          width: 100%;
          height: 30%;
        }

        .alice-carousel {
          width: 1px;
        }
      `}</style>
    </React.Fragment>
  );
};

export default HomePage;
